//Dependencies
import React, {Component} from 'react';

//assets
// TODO: styleSheet
 
class Footer extends Component {
  static propTypes ={
    copyright: PropTypes.string
  }
  render(){
    return (
      <div className="Footer">
        <p dangerouslySetInnerHTML={{__html:copyright}}/>
      </div>
    );
  };
}

export default Footer;
